with open(sample_filename, 'wb') as fout:
    decoded_sample = base64.decodebytes(sample_file)
    fout.write(zlib.decompress(decoded_sample))

# initialize reader object, could be different for different devices
reader = FSVRReader(sample_filename)
# initialize analyzer main object
analyzer = FSVRAnalysis(reader)
# set number of points to analyze, or 0 if all points
analyzer.set_data_points(0)
# set reference level
analyzer.set_threshold(-80)
# get main information from the data file
analyzer.get_info()
# do things...
analyzer.plot_last_frame()
analyzer.plot_avg_values()